import './App.css';

import React,{Component} from 'react';
//import data from './user/users_job.js';
import data from './user/users.js';



class Table extends Component{
  constructor(props){ 
    super(props);

    this.myUserList = data;
  };


  render(){
    return (
      <table>
        <thead style={{color:"blue",fontSize:"15px",width:"200px"}}><h1></h1></thead>
         <td>{this.myUserList.map(user=>user.user_first_name)}</td>
      </table>
    )
  };

}


export default Table;
